const [last, setlast] = useState({})

useEffect(() => {
  getAllLaunches().then((data) => setlaunches(data));
}, []);
console.log(last)
  return (
    <Section>
      {launches.map((item, index)=>{
        if (index > launches.length-3){
          setlast(item)
        return (
          <PastCard key={launches.id} title={launches.name} />
        );
        } 

      })}
    </Section>
  );
};

